import React, { Component } from 'react'
import './Signin.css'
import Spinner from '../../Factory/Spinner/Spinner';

export default class Signin extends Component {

  state = {
    email: '',
    password: '',
    submitted: false,
  }

  render() {
    return (
      <div className='Form'>
        Sign in
      </div>
    )
  }
}
